09 23:25:12',0,0),('200309HPNBPDFRP0','PTE 一次上岸分享','oDwsO5PtcxWPNXUlstxeRPrhpAhk','#考试考证','雅思转 PTE 一起七炸八炸??‍♀️',8,0,1,0,1,'2020-03-09 23:27:14',0,13),('200309K0252HTHX4','我来完成女朋友布置的作业?','oDwsO5JLULwzIbMf_Z_KZSD73gUs','#考试考证#端庄学术#干货','用生命码字给女朋友刷火箭?',2,0,0,0,3,'2020-03-09 23:49:25',0,0),('2003100PN1DFD8X4','美国得克萨斯大学达拉斯分校 交换分享','oDwsO5Bbe2izAk9n5cjfymg5f8F4','#交换','Hi大家好，我是宁诺计算机科学专业学生张轩铭，我现在正在美国的德克萨斯大学达拉斯分校进行交换学习。对于从小就向往美国的我来说，在达拉斯的这几个月让我真正感受到了最原汁原味的美国学习生活，从中也收获了很多不一样的感悟，接下来我就和学弟学妹们分享一下我在达拉斯交换的感受。\n\n美国德克萨斯大学达拉斯分校（UT Dallas）是美国一流的公立大学，是德克萨斯大学系统中奥斯汀分校外，又一所期望发展为美国前50的学校。成立于1969年的达拉斯分校的建校历史相对短暂，但是也是美国近几年来发展最为迅速的大学之一。达拉斯分校在2017年全美建校50年内的学校里排名第一。\n\n说完了学校的整体情况，再来看看UT Dallas的专业情况。因为我在宁诺是CS专业，所以在UT Dallas 上的课程也是对应的CS本科课程。UT Dallas的CS专业是工程学院（Erik Jonsson School of Engineering & Computer Science）下的一个小专业，同时也是工程学院学生人数最多的一个专业。工程学院也是UT Dallas最富盛名的学院之一，拥有非常雄厚的科研以及师资水平。\n\n我住在学校的校内公寓（Canyon Creek Heights North），这个宿舍楼是最近一年才盖起来非常新的一幢公寓楼，设施条件都非常齐全和完备。宿舍楼内部有非常多的社交场所，经常能在走廊里偶遇不同国家的小伙伴，是个锻炼英语口语的绝佳场所。\n\n之前我有提到过非常向往美国的生活，其中一个原因是很想体验纯正的美国课堂氛围。确实，美国的课堂真的是非常有趣的，教授和学生不再是简单的教学关系，更有一种朋友之间的交流关系。每堂课都会有很多的同学能够提出问题“质疑”教授，教授也能给出非常及时的\"反驳\"，有的时候甚至能演变成一场辩论。\n\n希望我的分享能给学弟学妹们带来帮助。我的建议是，如果你真的想感受纯正的美国教育氛围，那么UT Dallas确实是一个非常不错的选择。尽管对于交换生来说，可能需要面临的最大挑战就是能否适应美国生活和学习，作为一个过来人，我能做到，相信你也一定可以！只要你胸怀向往美国的梦想',12,0,14,0,1,'2020-03-10 01:02:04',0,46),('20031018BHS8RT7C','隐世于UNNC的搞笑派“畅销网文作家”？','oDwsO5HhYCIAP0AVpS4jRTLCvFlM','#端庄学术#宁诺新鲜事','上网课的新乐趣在于阅读 Dave 写的关于我和 Denis 写的万字小说? ? ? （讲述我费劲心思利用黑客技术阻挡 Denis 买花的故事...? ? ）',10,0,4,0,1,'2020-03-10 01:49:19',0,28),('2003102R7CS3X6Y8','分享一波土木的日常','oDwsO5DwqW67LTc-DIP7J-EiSHjg','#端庄学术','上午焊钢筋，下午活水泥\n日常工地赚钱，没空花钱',6,0,2,0,1,'2020-03-10 03:51:59',0,8),('20031032S23SRFRP','? 心累','oDwsO5DwqW67LTc-DIP7J-EiSHjg','#端庄学术','学习真的好烦好烦好烦，啊……\n\n唉:-(? ? ? ? ',9,0,3,0,1,'2020-03-10 04:20:34',0,10),('200310A4HKBN91P0','陆子野学术大法','oDwsO5AjGSIG5lxlWvP5ATFZ8OXo','#端庄学术','渗透学习法，是指将尚未学习过的但对后续学习或今后发展十分重要的知识，隐藏于睡梦之中，在不知不觉中有所感悟、体会，从而提高知识水平的方法。 用此法切记 循序渐进 不可一次贪多 ',15,0,7,0,1,'2020-03-10 14:14:29',0,17),('200310B6WK0592A8','快乐肥宅蜡笔小新','oDwsO5NF0RCV8YG1X4QWGCbaLTs4','#快乐肥宅','?',9,0,3,0,1,'2020-03-10 15:45:24',0,11),('200310D3T4KS5AW0','从0开始的练级生活','oDwsO5Btm6HsoGie6E8qB7WN9aYQ','#云看球','陪独行侠慢慢练级的生活',12,0,2,0,1,'2020-03-10 18:24:23',0,15),('200310FBPNRSDZ54','小朋友 你是否有很多问号❓','test3','#宁诺新鲜事','真的不想吐槽我们的网课了\nppt+音频\n俗称 有声读物\n',11,0,15,0,1,'2020-03-10 20:12:12',0,33),('200310FKTKB7MX8H','学校竟然发了vpn！！','test3','','学校发了vpn朋友圈都炸了\n但好像吐槽的人也挺多的！\n上不了外网只是连了一个学校的网而已\n',2,0,4,0,1,'2020-02-26 20:30:33',0,3),('200310FR78T59Z54','我“爱”我的西语老师','test3','#宁诺新鲜事','什么也不说了看图?‍♀️',14,0,16,0,1,'2020-03-10 20:40:48',0,33),('200310G7XS1PB06W','说实话','test11','#宁诺新鲜事','说实话我想mojar的墨西哥卷和86的蛋炒饭了',10,0,18,0,1,'2020-03-10 21:24:49',0,41),('200310GPK52AKNMW','申研timeline分享','oDwsO5MorWPzml_QeYekVZnRA1aw','#端庄学术','申请季差不多结束啦！整理了一下整个过程，还挺感慨的, 给大家分享一下！\n一些小tips: 1. 准备好的情况下，冲刺学校尽早申请！像IC, 越到后面越难，不要抱着捡漏的心理\n2. 保底学校可以适当晚申, 不然留位费好贵！\n3. 大三开始考语言, 雅思托福PTE尽早考！因为两年有效期\n4. 每个暑假都要好好安排, 实习/夏校/考试，三个月的暑假不要浪费啦\n5. 大一答应我好好玩好嘛☺️ \n\n\n',9,0,3,0,1,'2020-03-10 22:02:56',0,58),('2003118HNXGKHPH0','想美女了','oDwsO5NF0RCV8YG1X4QWGCbaLTs4','','?',5,0,8,0,1,'2020-03-11 12:02:43',0,38),('200311AB8CS8K9WH','4A 公关公司相关','oDwsO5EqayBkG8nqmORAKSU0QxkQ','#实习经验','4A 广告公关传媒公司数量超多，多 base 上海，行业整体对实习生的需求量也很高，实习生多工作量大+工资低，很多 IC 的小朋友在大二暑期都会去找这类实习\n\n1/ 一般公关公司对实习生需求量很大，在各类实习平台如实习僧，社交平台如微博，以及各类实习群都很容易找到相关招聘；招聘讯息上也会写明相关 team 的工作方向，如汽车品牌/生活产品/科技产品等等\n\n2/ 投递简历后一般会通过邮箱约线上或线下面试（公司多 prefer 线下）\n\n3/ 多以面试为主，可能包含笔试，一般由 HR+team 职员作为面试官。面试会偏向了解你的专业背景、性格、相关经验，基本看重策划 campaign 与新媒体运营经验，也会看你是否适合 team 工作节奏与氛围；笔试会了解英语水平，文字水平，翻译水平，个人创造性（让你为特殊节日的品牌 campaign 想主题之类的）。面试整体难度不大\n\n4/ 面试的时候也会向你说明工作内容 性质 工资（这类公司工资数属于实习生底层 80-110/day）等等，你有想知道的也可以抓紧问\n\n5/ 我之前在公关公司实习的时候所在 team 甲方有洋酒品牌，耳机，儿童动画，营养品牌等等。不同客户对应的工作也有不同，如洋酒品牌是需要我们 team 做线上平台运营，就会有推文/微博撰写等工作；营养品牌是做产品发布会，那就需要线下 conference 统筹，如联系媒体曝光、线下接待场控等等；也需要为一些品牌做推广方案，具体工作有竞品调查、渠道调查等等\n\n6/ 工作时间 10:00-18:00，大部分时候需要延迟下班 1-2h，难得会加班到午夜；team 工作氛围很好，同事都很有趣；也不会说让实习生报销打杂什么的，做的东西也相对核心，总体来说能学到很多东西\n\n7/ 对于还没有实习经验的小伙伴还是很推荐滴，面试难度不算高，能学到很多 工作氛围也不错',5,0,1,0,1,'2020-03-11 14:34:37',0,41),('200311BZ9MT4DP00','互联网运营类实习分享??‍♀️','oDwsO5FbTKAZPPaehO_AHkU3d15M','#实习经验','看到好多小朋友准备找暑假实习，给大家做一个互联网公司运营相关的实习分享～\n1.找实习：\n关注招聘官网岗位信息，可投递暑期实习or日常实习。在面试难度上暑期实习>日常实习，但日常实习时长要求3-6个月。\n2.面试：\n-日常实习分为直属leader面和HR面。主要还是会针对简历问一些过往实习或者活动经历，基本技能，职业规划等等。之前有互联网公司/新媒体运营相关经历的会比较加分。\n-leader一般会问关于本公司产品相关问题，需要提前做好功课✍?\n-HR对抗压能力要求高，可以在这方面好好答\n3.工作内容：\n我实习的岗位是广告运营相关，工作就是为品牌方提供数字营销，主要涉及广告/电商两种模式。\n具体的工作内容有以下几个方面：产品培训?营销方案策划?素材拍摄?媒介投放?数据监测与维护\n能帮你快速入门互联网营销+爆款策略??‍♀️\n4.整体评价：???\n? 公司年轻化氛围比较好\n? 内部培训多，能蹭到很多学习机会\n? 薪资可观。一二线城市薪资150/天+房补餐补等\n? 工作量较大，会需要加班。晚上到七八点都比较正常，周末试情况而定会正常给加班费\n5.Tips：实习生基本都是prefer大三，对于想进互联网公司做运营的小朋友，可以先找相关实习积累经验。',7,0,1,0,1,'2020-03-11 16:46:52',0,41),('200311D3W1W516Y8','薯片鸡翅！超好吃！（快落','oDwsO5MorWPzml_QeYekVZnRA1aw','#快乐肥宅','第一次尝试薯片鸡翅！成功！\n做法: 鸡翅先用料酒，奥尔良腌制料，蒜，姜，腌制半小时，然后依次裹上淀粉，鸡蛋液，薯片碎，放入预热的烤箱 140度上下管30min！外酥里嫩超好次！',11,0,3,0,1,'2020-03-11 18:24:29',0,30),('200311FZD8WSF894','华米科技-战略投资部实习生','oDwsO5OoakmHmns6iDxR2ux3vk8A','#实习推送','岗位职责\n1、辅助项目质量、进度控制与管理\n2、协助项目经理完日常业务沟通\n3、整理和分析数据，提供决策支持数据与分析报表\n4、进行项目物资、文件资料的收发整理、备案和归档\n\n\n岗位需求\n1.财会、金融、经济专业本科及以上学历；\n2.具有公司与市场研究、行业分析经验者优先；\n3.熟练使用excel，或英语优秀者优先；\n4.踏实勤奋，能长期实习，每周实习4天以上；\n5.疫情期间可远程实习\n\n\n薪酬福利\n实习工资：本科170/天；硕士210/天 \n公司福利：每天当季水果供应，免费的健身房及运动社团\n\n\n简历投递方式\n1. 投递邮箱：wangyuanhao@huami.com\n2. 邮件命名：岗位+姓名',8,0,0,0,1,'2020-03-11 20:59:28',0,21),('200312B0ATF0HFA8','死磕GRE，159+168 经验帖','oDwsO5MorWPzml_QeYekVZnRA1aw','#考试考证#端庄学术','先说一下本人情况，三战GRE, V159 Q168 成功上岸，目前拿到了华盛顿圣路易斯MSBA的offer，死磕了好几个月的GRE跟大家分享一下心得~\n\ngeneral：建议大三下+暑假来准备，周期不要拖太长，相信我，一个月的时间 单词就会忘光。\n\n单词：我用的是要你命3k的app，临考前背鸡精词，单词真的很重要！不然填空啥都看不懂\n\n阅读：GRE的阅读是很讲逻辑的，文章不长，一定要擅于分析每句话在段落中的作用，以及前后句子关系，是承接（正向）还是转折（反向）。建议第一遍通读了解文章观点+逻辑，做对主旨题，然后细节题再回去找，因为时间真的非常非常紧，加上填空只有30min\n\n填空：单空考词汇，双空三空考逻辑，短短的句子可以判断哪个空跟哪个词取同/取反，然后可以找对应，三空比较难，要全部做对才给分，可以适当放弃。等价可以背等价词，难度稍低。\n\n数学：做一套易错题就差不多了。我二战数学满分，但三战只有168。\n\n应考：考前一定要做模考，verbal的时间是特别特别重要的，后期可以一套verbal这样练，控制时间。\nGRE真的比语言难很多！先想好需不需要考G，美国和欧洲要G，英国的话去看你想申的专业的具体要求，要是决定考就做好心理准备，一鼓作气！不然真的很痛苦。\n\n报名tips：如果不自信的话可以连续报两场，以防考位紧张，过一个多月 单词又生疏了。\n大家加油！',20,0,4,0,1,'2020-03-12 15:25:55',0,72),('200312BFSDNBFR1P','UNNC 数学夏校','oDwsO5NNJ_B_i0B3QPHfLhsa74Rk','#端庄学术','去年暑假上了我们学校的数学夏校，一共上了 Linear Algebra and Calculus，Probability and Statistics 四块\n前两块是数学系 Head Bruce 教的，Bruce 真的很帅人也很好，用传统的教数学方法，他会把每一步都写在黑板上清清楚楚\n后面两块是数学系女神老师 Chong You 上的，她能把教的内容都讲的很清楚\n我觉得还是非常值得上夏校的，对申研也很有帮助\n\n\n\n\n\n\n\n\n',13,0,3,0,1,'2020-03-12 16:09:10',0,67),('200312DGD8F336CH','当你不指望?宝给你推好东西时','oDwsO5CIdBj7WCTrGdIzJ4Xssyvg','#xswl','??‍♂️??‍♂️??‍♂️',11,0,2,0,1,'2020-03-12 18:59:22',0,31),('200312H29YBA0B2W','#LOL春季赛#新军ES以4连胜战绩第一','oDwsO5GLbWOFvsgJfQe1FOF_Oj4g','#游戏电竞','我就想问一句：水子哥到底去哪里了?',10,0,0,0,1,'2020-03-12 22:32:10',0,11),('200313AZT40TF800','求UNUK租房推荐?','oDwsO5N86Xd45qMoSUfTr6QQ0Vzg','#交换','本人下半年去诺丁村了，各位学姐学长也没有比较靠谱的房子推荐。单间的整栋的都可～',12,0,4,0,1,'2020-03-13 15:24:14',0,55),('200313F01A4AS2CH','两次四杀就约等于五杀吧','oDwsO5GLbWOFvsgJfQe1FOF_Oj4g','#游戏电竞','这10/0的卡萨丁，我觉得就你?离谱。',9,0,8,0,1,'2020-03-13 19:37:06',0,29),('200313F3WCWZ744H','我人都傻了','oDwsO5Knpx0m5-23gmAiUj59oPFA','','英国脱完欧准备脱离地球吗，这波是为了人口老龄化做贡献?2+2别变成3+1嗷',10,0,2,0,1,'2020-03-13 19:48:35',0,28),('200313F5BZ2CZR40','MHWi 求组队','oDwsO5F5IPy1vbac958rJP-MLV6A','','太刀侠，见切如风，居合必叮，从来不猫',9,0,4,0,1,'2020-03-13 19:53:16',0,20),('200313F5TDZG5AFW','进 化 算 法','oDwsO5G_RUO086t0r6d0St3GeTRU','','????',10,0,1,0,1,'2020-03-13 19:54:30',0,19),('200313F5W601ZHX4','进 化 算 法','oDwsO5G_RUO086t0r6d0St3GeTRU','','????',0,0,0,0,3,'2020-03-13 19:54:35',0,4),('200313FKSRGWKRKP','马克思??','oDwsO5DzWRGya-Y6twD3A2lKZghA','','本来每天出不去门就有够自闭，还要思考哲学问题。这样下去有望成仙了?',16,0,4,0,1,'2020-03-13 20:30:27',0,25),('200313FTTWW9WFNC','大三学生蹲一个申研机构推荐or排雷','oDwsO5JiYwhrp5_nuxwDc117phC0','#宁诺新鲜事#干货','有没有学长学姐能来说说自己的申研机构啊_(:τ」∠)_现在大三了看着机构发愁，求推荐求排雷谢谢大家了！最好带上专业和目标院校地区这样！',18,0,12,0,1,'2020-03-13 20:48:35',0,95),('200313G0KP7HXWX4','Home office太难了','oDwsO5HTApjMo71F9rbq1lP-6DJA','','每天都要和无数的诱惑作斗争',7,0,1,0,1,'2020-03-13 21:02:56',0,17),('200313GBTF29CMY8','reading看不下去','oDwsO5NbkfdkMWwjktjCJJAdjTWQ','#宁诺新鲜事','大家在家reading看不下去