校老师感觉憨憨的还没有我了解学校??‍♂️没咋想也排除了\n最后选择了第一家中介现在拿到ICBS Economics&Strategy for Business以及UCL Comparative Business Economics offer\n\n总之面谈是关键，希望大家选择中介的时候擦亮眼睛??',22,0,6,0,1,'2020-03-14 21:06:49',0,73),('200314G5HK4H18H0','推荐一个超好玩的手机游戏！','test14','#游戏电竞','WalkMaster！\n真的玩上瘾了就停不下来\n现在特别火的一个游戏\n推荐给大家',12,0,1,0,1,'2020-03-14 21:17:50',0,24),('200314GX1HSZHR68','?','oDwsO5Dh5HT2umBiEegqBWyjbei0','','抗疫情 放传播',2,0,4,0,0,'2020-03-14 22:16:16',0,5),('200314H0RXZM465P','想被种草?色口红QuQ','oDwsO5PQpp_Jby67TC4XWQ36hpi8','','有推荐的咩姐妹们',7,0,3,0,1,'2020-03-14 22:27:28',0,35),('200314H10XKD6BXP','?','oDwsO5Dh5HT2umBiEegqBWyjbei0','','XDZ推荐了美剧《安眠書店》',10,0,5,0,1,'2020-03-14 22:28:13',0,37),('20031598NK8KWZR4','中英航线切断预警！','oDwsO5JL9WJ4RsbeT3yjsyoLuoLU','#交换#宁诺新鲜事','虽然是个建议，但是胡锡进的话还是有可能被采纳的！',7,0,0,0,1,'2020-03-15 13:02:44',0,11),('200315CFDX2PBK68','求英诺租房推荐！','test12','#交换','学长学姐有没有什么推荐呀，看了好多我都晕了。 还有要不要找中介？',12,0,7,0,1,'2020-03-15 17:32:21',0,58),('200315D9WPKD4ACH','求购','test11','#宁诺新鲜事#健身达人#局','大神们有没有二手碟机？\n帮朋友问问\n\n图文无关',5,0,1,0,1,'2020-03-15 18:42:34',0,22),('200315DR2C4YX77C','分享一张park地图','test14','#交换','看票圈的大家都在准备交换啦，分享一张英诺park校区的地图~  去UNUK交换的小伙伴可以码起来~',4,0,3,0,1,'2020-03-15 19:16:13',0,18),('200315G2XYT1GK68','?的爆笑事件！真实事件','oDwsO5N8_Gu5419ijnEpTfgu1RXA','#UNNC搞笑大赛','记得大二的时候 在mojar和朋友们小酌一下 隔壁桌的某位男同学（是我不是很熟但是有很多交集的酒桌朋友）看见我在这桌就跑来敬酒 非要和我摇骰子吹牛 那就玩呗！\n\n他是很能喝的那种 虽然我也能喝一点小酒 我的酒量根本不如他 吹牛也不一定能玩的过他 但是气势上东北女生不能输！\n\n旁边坐着我的一个小朋友学弟 在旁边调酒 当时喝的是绝对伏特加兑冰红茶 我和那个男生 摇骰子的节奏超级快 输了就一杯 按这个节奏估计玩一会一扎就没了 \n\n我们两个人的比赛如火如荼的进行 我一杯他一杯 我两杯他两杯 不分胜负 我俩的气势谁都不输给谁 \n\n我们和空了的酒杯往旁边一放 学弟就给我们满上 给我的杯子里装了满满的一杯冰红茶 给那个和我喝酒的男生装的高浓度的伏特加?‍♀️\n\n我和他谁都没有发现这个操作 输了一盘之后喝进去的时候发现怎么不对劲？这个酒怎么没有酒精的味道？我看向他他冲我摇了摇手里的冰红茶 差点没为他的机智笑出声来！！但我还装的很淡定的样子 一口闷了那杯冰红茶 剩下的几杯 当然都是一口闷掉的 秒喝掉了“高浓度伏特加”\n那个男生心里一定特别佩服 这个东北女生可真能喝！！\n\n比赛的结果是我赢了 他喝到实在晕的不行 我还什么事都没有 气势上比他高了不知道多少个层次?‍♀️他摇摇晃晃的站起来 “姐 我服了！我真服了 你可太能喝了！喝不过你！你太??了！！” \n\n',12,0,2,0,1,'2020-03-15 21:09:49',0,69),('200315H924DK5KP0','听说有比赛？','oDwsO5Mjxnj2-O1yXl064bOQbELQ','#UNNC搞笑大赛#宁诺新鲜事#xswl','我来参赛了 @产品运营，颤抖吧',1,0,0,0